import '../styles/App.css';
import '../styles/Intro.css';
function Intro() {
  return (
    <div className='app-body app-body-comp'>
        <ul>
            <li>HTML</li>
            <li>CSS</li>
            <li>JS</li>
            <li>SSG</li>
            <li>webdev</li>
            <li>animation</li>
            <li>UI/UX</li>
         </ul>
    </div>
  );
}

export default Intro;
